import React from "react";

const Pagination = () => {
  let next = () => {};
  let prev = () => {};

  return (
    <div className="container">
      <button onClick={prev} className="btn btn-primary">
        Prev
      </button>
      <button className="btn btn-primary">Next</button>
    </div>
  );
};

export default Pagination;
